(function() {
  $(function() {
    var page_container;
    page_container = $("#lost_account_finder");
    return page_container.find(".submit_btn").click(function() {
      var form;
      form = page_container.find("form");
      if (form.attr('remote') === "true") {
        $('.spinner').toggleClass("hidden");
        $.ajax(form.attr("action"), {
          type: "post",
          data: form.serialize(),
          success: function(res) {
            $('.success_container .inner').text(res['message']);
            return $('.success_container, .spinner').toggleClass('hidden');
          },
          error: function(res) {
            $('.error_container .inner').text(res['message']);
            return $('.error_container, .spinner').toggleClass('hidden');
          }
        });
      } else {
        form.submit();
      }
      return false;
    });
  });

}).call(this);




